import React, { Component } from 'react'
import Img from '../../../assets/images/profile.jpg'
import Btn from '../../container/Btn';

class Info extends Component {
    render() {
        return (
            <div className='info d-flex justify-content-between align-items-center gap-2'>
                <div className='img'>
                    <img src={Img} alt="profile" className='rounded-5' />
                </div>
                <div className='details'>
                    <span className='bg-pink p-2 rounded-5 text-white'>offline</span>
                    <h3 className='text-white mt-3 fw-bold'>alan smithee</h3>
                    <p className='text-secondary'>You Haven't Gone Live yet. Go Live By Touching The Button Below.</p>
                    <Btn name="start live stream" link="../streams"/>
                </div>
            </div>
        )
    }
}

export default Info;
